import React from "react";
import "./welcome-message.scss";

function WelcomeMessage(props) {
  return (
    <div>
      <span>welcome</span>
      <div>
        {props.isConnectet ? (
          <span> props.name </span>
        ) : (
          <div>
            <span>welcome</span>
            <WeShopButton
              text="Register"
              onClick={() => props.onCLick()}
            ></WeShopButton>
          </div>
        )}
      </div>
    </div>
  );
}

export default WelcomeMessage;
